import React from 'react'
import Manifest from './manifest.json'
import Data from './data.png'
import Support from './support.png'
import Team from './team.png'

const Section = (data) => {
    var i = data.data
    return (
    <div className='flex flex-col mx-5 p-7 border border-black border-opacity-20 rounded-xl text-center w-72'>
        <img src={Data} alt='word' className='w-28 mx-auto'/>
        <div className='font-extrabold text-2xl leading-snug mb-8 opacity-90 md:text-4xl md:mb-7'>{i.heading}</div>
        <div className='font-normal text-sm leading-relaxed opacity-90 md:text-base'>{i.paragraph}</div>
    </div>
    )
}

const TheWhy = () => {
    return (
    <div className='lg:flex flex-col bg-white mb-20 text-center'>
        <div className='font-extrabold text-2xl opacity-80 mb-12 p-10 pb-0'>{Manifest.title}</div>
        <div className='mx-auto overflow-y-scroll p-10 px-20'>
            <div className='grid grid-flow-col grid-cols-3 w-max h-72'>
            {Manifest.content.map((i, key) => {
                    return <Section key={key} data={i}/>;
                    })}
            </div>
        </div>
    </div>
    )
}

export default TheWhy
